import logo from './logo.svg';
import './App.css';
import './componentes/challenge'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Texto antes do code <code>esse ta dentro da tag code em App.js</code> testo que ta no p em App.js.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Aqui o testo que que faz o link ta no a do App.js
        </a>
      </header>
    </div>
  );
}

export default App;
